import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope } from '@fortawesome/free-solid-svg-icons'

const Socials = () => {
    return(
        <div>
            <FontAwesomeIcon icon={faEnvelope} />
            <p>GitHub</p>
            <p>LinkdIn</p>
            <p>Instagram</p>
        </div>    
    );
}

export default Socials;
